function BreadcrumbsPos({triggers, index}) {
    return (
        <>
            <h3>Position</h3>
            <p>X: {triggers[index].Breadcrumbs?.Position[0]}</p>
            <p>Y: {triggers[index].Breadcrumbs?.Position[1]}</p>
            <p>Z: {triggers[index].Breadcrumbs?.Position[2]}</p>
        </>
    );
}

export default BreadcrumbsPos;
